categories = ['<=5', '<=7', '<=11', '<=37', 'all']

def data(d): 
    # Initialize a dictionary to organize data by category
    if d == 'onehop': 
        d = onehop
    elif d== 'twohop': 
        d = twohop 
    elif d== 'threehop': 
        d = threehop
    category_data = {cat: {metric: [] for metric in d[0].keys() if metric != 'auc'} for cat in categories}

    # Process each dictionary in onehop
    for data in d:
        for metric, values in data.items():
            if metric == 'auc':
                continue  # Skip auc as it is not category-specific
            for idx, value in enumerate(values):
                category_data[categories[idx]][metric].append(value)
    cat1 = category_data['<=5']
    cat2 = category_data['<=7']
    cat3 = category_data['<=11']
    cat4 = category_data['<=37']
    cat5 = category_data['all']
    return cat1, cat2, cat3, cat4, cat5


def metric(metric, math,cat1, cat2, cat3, cat4): 
    results = [np.round(math(cat1[str(metric)]),4), np.round(math(cat2[str(metric)]),4),np.round(math(cat3[str(metric)]),4),np.round(math(cat4[str(metric)]),4)]
    return results

def metric2(metric, math, cat): 
    #results = np.round(math(cat[str(metric)],4))
    results =np.round(math(cat[str(metric)]),4)
    return results 

